const Header = (props) => {
    return (
      <div>
        <h1>{props.courseName}</h1>
      </div>
    )
}

const Part = (props) => {
  return (
    <div>
      <p>
        {props.name} {props.numExercises}
      </p>
    </div>
  )
}

const Content = (props) => {
  return (
    <div>
      <Part name={props.parts[0].name} numExercises={props.parts[0].exercises}/>

    </div>
  )
}

const Total = (props) => {
  return (
    <div>
      <p>
      Number of exercises {props.numExercises1 + props.numExercises2 + props.numExercises3}
      </p>
    </div>
  )
}

const App = () => {
  const course = 'Half Stack application development'


  const parts = [
    {
      name: 'Fundamentals of React',
      exercises: 10
    },
    {
      name: 'Using props to pass data',
      exercises: 7
    },
    {
      name: 'State of a component',
      exercises: 14
    }
  ]

  return (
    <div>
      <Header courseName={course}/>
      <Content parts={parts}/>
      <Total parts={parts}/>
    </div>
  )
}

export default App
